// import Contacto from './Contacto/Contacto'
import "./nosotros.css"
import imagen from '../img/img7.png'
export default function Nosotros() {
  return (
    <div>
      <h1> Bienvenido a C&V Comidas Caseras</h1>
      <img 
              alt="comida"
              src= {imagen}
              width="100"
              height="100"
              className="align-top"
            />
    </div>
  )
}
